import {SIGNED_IN,SIGNED_OUT} from './types';

export const signedIn = () => {
    return (dispatch) => {
        dispatch({
            type: SIGNED_IN,
        })
    }
}

export const signedOut = () => {
     (dispatch) => {
        dispatch({
            type: SIGNED_OUT,
        })
    }
}
